-- Check for duplicates in each table
SELECT *
FROM Appointment a
WHERE EXISTS (
    SELECT 1
    FROM Appointment b
    WHERE a.appointment_Id = b.appointment_Id
    GROUP BY b.appointment_Id
    HAVING COUNT(*) > 1
);
 
 SELECT *
FROM Department d
WHERE EXISTS (
    SELECT 1
    FROM Department t
    WHERE d.dept_Id = t.dept_Id
    GROUP BY t.dept_Id
    HAVING COUNT(*) > 1
);

 SELECT *
FROM Room r
WHERE EXISTS (
    SELECT 1
    FROM Room o
    WHERE r.room_No = o.room_No
    GROUP BY o.room_No
    HAVING COUNT(*) > 1
);  
 SELECT *
FROM Doctor c
WHERE EXISTS (
    SELECT 1
    FROM Doctor f
    WHERE c.doct_id = f.doct_id
    GROUP BY f.doct_id
    HAVING COUNT(*) > 1
);
 SELECT *
FROM Nurse n 
WHERE EXISTS (
    SELECT 1
    FROM Nurse u
    WHERE n.nurse_id = u.nurse_id
    GROUP BY u.nurse_id
    HAVING COUNT(*) > 1
);
 SELECT *
FROM Helpers h
WHERE EXISTS (
    SELECT 1
    FROM Helpers s
    WHERE h.helper_id = s.helper_id 
    GROUP BY s.helper_id 
    HAVING COUNT(*) > 1
);
 SELECT *
FROM Patients p 
WHERE EXISTS (
    SELECT 1
    FROM Patients i
    WHERE p.patient_Id = i.patient_Id
    GROUP BY i.patient_Id
    HAVING COUNT(*) > 1
); 
 SELECT *
FROM RoomRecords w
WHERE EXISTS (
    SELECT 1
    FROM RoomRecords e
    WHERE w.admisson_ID = e.admisson_ID
    GROUP BY e.admisson_ID
    HAVING COUNT(*) > 1
); 
 SELECT *
FROM MedicalRecord mr
WHERE EXISTS (
    SELECT 1
    FROM MedicalRecord me
    WHERE mr.record_Id =  me.record_Id
    GROUP BY  me.record_Id
    HAVING COUNT(*) > 1
); 
SELECT *
FROM SurgeryRecord sr
WHERE EXISTS (
    SELECT 1
    FROM SurgeryRecord rs
    WHERE sr.surgery_Id =  rs.surgery_Id
    GROUP BY rs.surgery_Id
    HAVING COUNT(*) > 1
); 
