ALTER TABLE MedicalRecord
ADD previousvisits_count INT;

SELECT 
    m.record_Id,
    m.doct_Id,
    m.patient_Id,
    m.visit_Date,
    m.curr_Weight,
    m.curr_height,
    m.curr_Blood_Pressure,
    m.curr_Temp_F,
    m.diagnosis,
    m.treatment,
    COALESCE(m.next_Visit, '2025-01-01') AS Next_visit,
    m.Treatment_price,
    pv.previousvisits_count
FROM MedicalRecord AS m
LEFT JOIN (
    SELECT 
        patient_Id,
        COUNT(*) AS previousvisits_count
    FROM MedicalRecord
    GROUP BY patient_Id
) pv ON m.patient_Id = pv.patient_Id;


